import {
    Box,
    Typography,
    IconButton,
    TextField,
    Button,
    useTheme,
  } from "@mui/material";
  import { Edit, Delete, Save, Cancel } from "@mui/icons-material";
  import { useState } from "react";
  import { useSelector } from "react-redux";

  const PostWidget = ({
    postId,
    postUserId,
    name,
    description,
    legalDomain,
    location,
    picturePath,
    userPicturePath,
    interests,
    comments,
    buttonDisable,
  }) => {
    const { palette } = useTheme();
    const main = palette.neutral.main;
    const primary = palette.primary.main;

    const loggedInUserId = useSelector((state) => state.user._id);
    const userType = useSelector((state) => state.user.userType);
    const token = useSelector((state) => state.token);

    const isOwnerOrAdmin = loggedInUserId === postUserId || userType === "admin";

    const [isEditing, setIsEditing] = useState(false);
    const [editedDescription, setEditedDescription] = useState(description);
    const [editedDomain, setEditedDomain] = useState(legalDomain);

    const handleDelete = async () => {
      try {
        const response = await fetch(`http://localhost:5000/posts/${postId}`, {
          method: "DELETE",
          headers: {
            Authorization: `Bearer ${token}`,
            "Content-Type": "application/json",
          },
          body: JSON.stringify({
            userId: loggedInUserId,
            userType: userType,
          }),
        });

        if (response.ok) {
          alert("Post deleted successfully.");
          window.location.href = "/dashboard"; // or redirect appropriately
        } else {
          alert("Failed to delete post.");
        }
      } catch (err) {
        console.error("Error deleting post:", err);
      }
    };

    const handleEdit = async () => {
      try {
        const response = await fetch(`http://localhost:5000/posts/${postId}`, {
          method: "PUT",
          headers: {
            Authorization: `Bearer ${token}`,
            "Content-Type": "application/json",
          },
          body: JSON.stringify({
            userId: loggedInUserId,
            userType: userType,
            description: editedDescription,
            legalDomain: editedDomain,
          }),
        });

        if (response.ok) {
          alert("Post updated successfully.");
          setIsEditing(false);
        } else {
          alert("Failed to update post.");
        }
      } catch (err) {
        console.error("Error updating post:", err);
      }
    };

    return (
      <Box sx={{ border: "1px solid #ccc", borderRadius: "8px", p: 2 }}>
        {isEditing ? (
          <>
            <TextField
              fullWidth
              label="Description"
              multiline
              rows={4}
              value={editedDescription}
              onChange={(e) => setEditedDescription(e.target.value)}
              sx={{ mb: 2 }}
            />
            <TextField
              fullWidth
              label="Legal Domain"
              value={editedDomain}
              onChange={(e) => setEditedDomain(e.target.value)}
              sx={{ mb: 2 }}
            />
            <Box display="flex" justifyContent="flex-end" gap={2}>
              <Button
                variant="contained"
                color="success"
                startIcon={<Save />}
                onClick={handleEdit}
              >
                Save
              </Button>
              <Button
                variant="outlined"
                color="secondary"
                startIcon={<Cancel />}
                onClick={() => setIsEditing(false)}
              >
                Cancel
              </Button>
            </Box>
          </>
        ) : (
          <>
            <Typography variant="h4" color={primary} gutterBottom>
              {editedDomain}
            </Typography>
            <Typography color={main} sx={{ mb: 2 }}>
              {editedDescription}
            </Typography>

            {isOwnerOrAdmin && (
              <Box display="flex" justifyContent="flex-end" gap={1}>
                <IconButton onClick={() => setIsEditing(true)}>
                  <Edit sx={{ color: primary }} />
                </IconButton>
                <IconButton onClick={handleDelete}>
                  <Delete sx={{ color: "red" }} />
                </IconButton>
              </Box>
            )}
          </>
        )}
      </Box>
    );
  };

  export default PostWidget;
